// Footer.js
import React from 'react';
import './Footer.css';
import '../Images/logo.jpg'

function Footer() {
  return (
    <footer style={{ backgroundColor: 'lightgray', padding: '10px', textAlign: 'center' }}>
        <image src='logo.jpg' width='50px' height={'50px'}></image>
    </footer>
  );
}

export default Footer;
